import './App.css';
import {BrowserRouter as Router,Route,Switch} from "react-router-dom";
import createFlight from "./Components/createFlight";
function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
             <Route exactpath = "/createFlight" component={createFlight}/>
          </Switch>
        </Router>
    </div>
  );
}

export default App;
